MongoDB custom sort order for a query with pagination<p>I have some documents in a MongoDB collection with this schema:</p>
<pre><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60c1e8e318afd80016ce58b1&quot;
    },
    &quot;searchPriority&quot;: 1,
    &quot;isLive&quot;: false,
    &quot;vehicleCondition&quot;: &quot;USED&quot;,
    &quot;vehicleDetails&quot;: {
        &quot;city&quot;: &quot;Delhi&quot;
    }
},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60c1f2f418afd80016ce58b5&quot;
    },
    &quot;searchPriority&quot;: 2,
    &quot;isLive&quot;: false,
    &quot;vehicleCondition&quot;: &quot;USED&quot;,
    &quot;vehicleDetails&quot;: {
        &quot;city&quot;: &quot;Delhi&quot;
    }
},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60cb429eadd33c00139d2be7&quot;
    },
    &quot;searchPriority&quot;: 1,
    &quot;isLive&quot;: false,
    &quot;vehicleCondition&quot;: &quot;USED&quot;,
    &quot;vehicleDetails&quot;: {
        &quot;city&quot;: &quot;Gurugram&quot;
    }
},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60c21be618afd80016ce5905&quot;
    },
    &quot;searchPriority&quot;: 2,
    &quot;isLive&quot;: false,
    &quot;vehicleCondition&quot;: &quot;USED&quot;,
    &quot;vehicleDetails&quot;: {
        &quot;city&quot;: &quot;New Delhi&quot;
    }
},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60e306d29e452d00134b978f&quot;
    },
    &quot;searchPriority&quot;: 3,
    &quot;isLive&quot;: false,
    &quot;vehicleCondition&quot;: &quot;USED&quot;,
    &quot;vehicleDetails&quot;: {
        &quot;city&quot;: &quot;New Delhi&quot;
    }
}
</code></pre>
<p><code>vehicleCondition</code> can be <code>NEW</code> or <code>USED</code>, <code>isLive</code> can be <code>true</code> or <code>false</code> and <code>searchPriority</code> will be an integer between 1 to 3. (lower number means it should be higher in search result)</p>
<p>Here, except <code>_id</code> none of the other fields are unique. I have created a compound index on  <code>isLive</code>, <code>vehicleDetails.city</code> and <code>searchPriority</code>.</p>
<p>In my application I will perform some queries of this form:</p>
<ul>
<li>find all cars where <code>isLive</code> is <code>true</code>, <code>vehicleDetails.city</code> is
either <code>Delhi</code> or <code>New Delhi</code> or <code>Gurugram</code> and <code>vehicleCondition</code> is
<code>USED</code> (or <code>NEW</code>).</li>
</ul>
<p>For this, I can do a find query like this:</p>
<pre><code>db.collection.find({&quot;isLive&quot;: true, &quot;vehicleDetails.city&quot;: { $in: [ &quot;Gurugram&quot;, &quot;Delhi&quot;, &quot;New Delhi&quot; ] }, &quot;vehicleCondition&quot;: &quot;USED&quot; }, {})
</code></pre>
<p>I want the results of this query sorted in this order:</p>
<ul>
<li>All cars belonging to the 1st city inside <code>$in</code> arrray in the find query, having lowest priority</li>
<li>All cars belonging to the 1st city inside <code>$in</code> arrray in the find query, having  2nd lowest priority</li>
<li>All cars belonging to the 1st city inside <code>$in</code> arrray in the find
query, having 3rd lowest priority</li>
<li>All cars belonging to the 2nd city inside <code>$in</code> arrray in the find query, having lowest priority</li>
<li>All cars belonging to the 2nd city inside <code>$in</code> arrray in the find query, having 2nd lowest priority</li>
<li>All cars belonging to the 2nd city inside <code>$in</code> arrray in the find query, having 3rd lowest priority
All cars belonging to the 3rd city inside <code>$in</code> arrray in the find query, having lowest priority</li>
<li>All cars belonging to the 3rd city inside <code>$in</code> arrray in the find query, having 2nd lowest priority</li>
<li>All cars belonging to the 3rd city inside <code>$in</code> arrray in the find query, having 3rd lowest priority</li>
</ul>
<p>How can I do this? Since the number of documents returned by this query could be very large, I will be using pagination to limit the number of returned documents. Will this extra requirement have any effect on the possible solution for this problem?</p>

