Mongodb aggregate $size not returning results?<p>I have data like this:</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;60ccb13a21d65f0c7c4c0690&quot;,
    &quot;username&quot;: &quot;testuser&quot;,
    &quot;friendRequests&quot;: [
      {
        &quot;_id&quot;: &quot;60ccb13a21d65f0c7c4c0690&quot;,

      }
    ]
  }
]
</code></pre>
<p>And code like this:</p>
<pre><code>router.use(async function(req, res, next){

    try {
        res.locals.fr = await User.aggregate([
            {$match:{username: &quot;testuser&quot;}},    
            {$project: {
                frCount: {
                  $size: &quot;$friendRequests&quot;
                }
              }}]),
        res.locals.login = req.isAuthenticated();
        res.locals.newProfile = req.user;
        next();
    }
    catch {
        res.locals.login = req.isAuthenticated();
        res.locals.newProfile = req.user;
        next();
    }

});
</code></pre>
<p>Shouldnt it return this?</p>
<pre><code>[
  {
    &quot;frCount&quot;: 1,
    &quot;_id&quot;: ObjectId(&quot;60ccb13a21d65f0c7c4c0690&quot;)
  }
]
</code></pre>
<p>Then if I put this in EJS:</p>
<pre><code>&lt;p&gt;requests: &lt;%= fr.frCount %&gt;&lt;/p&gt;
</code></pre>
<p>Shouldn't it return 1? However, it returns nothing and I'm not sure why.</p>

