MongoDB lookup and filter by foreign documents<p>I've <code>user</code> collection which has role object which has roleId. I also have <code>roles</code> collection which has id.
Now, for each role, I'd like to get the list of users.</p>
<p>Ex:</p>
<pre><code>[
    {
        &quot;name&quot;: &quot;Scott&quot;,
        &quot;isActive&quot;: true,
        &quot;role&quot;: {
            &quot;roleId&quot;: &quot;123432&quot;
        }
    },
    {
        &quot;name&quot;: &quot;John&quot;,
        &quot;isActive&quot;: true,
        &quot;role&quot;: {
            &quot;roleId&quot;: &quot;123432&quot;
        }
    },
    {
        &quot;name&quot;: &quot;Scott&quot;,
        &quot;isActive&quot;: true,
        &quot;role&quot;: {
            &quot;roleId&quot;: &quot;556432&quot;
        }
    }
]
</code></pre>
<p>Roles Data:</p>
<pre><code>[
    {
        &quot;id&quot;: &quot;123432&quot;
        &quot;name&quot;: &quot;admin&quot;,
        &quot;type&quot;: &quot;internal&quot;
    },
    {
        &quot;id&quot;: &quot;556432&quot;
        &quot;name&quot;: &quot;owner&quot;,
        &quot;type&quot;: &quot;external&quot;
    },
    {
        &quot;id&quot;: &quot;556432&quot;
        &quot;name&quot;: &quot;owner&quot;,
        &quot;type&quot;: &quot;internal&quot;
    } 
]
</code></pre>
<p>Now  I want to get all the roles of type <code>internal</code> and their related users:</p>
<p>So, the output should be,</p>
<pre><code>[
    {
       &quot;role&quot;: &quot;123432&quot;,
        &quot;users&quot;: [
            {
                &quot;name&quot;: &quot;Scott&quot;,
                &quot;role&quot;: {
                    &quot;roleId&quot;: &quot;123432&quot;
                }
            },
            {
                &quot;name&quot;: &quot;John&quot;,
                &quot;role&quot;: {
                    &quot;roleId&quot;: &quot;123432&quot;
                }
            }
        ],
        { 
            &quot;role&quot;: &quot;556432&quot;,
            &quot;users&quot;: []
         }
    }
]
</code></pre>
<p>This is my aggregation in SpringBoort:</p>
<pre><code>LookupOperation lookupOperation = LookupOperation.newLookup().from(&quot;roles&quot;).localField(&quot;roleId&quot;)
                .foreignField(&quot;_id&quot;).as(&quot;roles&quot;);

        AggregationOperation match = Aggregation.match(Criteria.where(&quot;type&quot;).is(&quot;internal&quot;));

        Aggregation aggregation = Aggregation.newAggregation(lookupOperation, match);

        List&lt;UserDTO&gt; results = mongoTemplate.aggregate(aggregation, &quot;users&quot;, UserDTO.class).getMappedResults();
</code></pre>
<p>But this is not working. The match filter ois working with main table (users) field. But it is not working with foreign collection(roles)</p>
<p>Can someone help me on this please?</p>

