Unable to get MongoDB Change stream documents to appear in a watcher service<p>I have a service that needs to watch a collection on a Mongo DB to create changes in the system. I have managed to establish a connection to a replica set using the C# driver and I'm using the following code to test the change stream.</p>
<pre class="lang-cs prettyprint-override"><code>public async Task WatchLoopAsync()
{
    var options = new ChangeStreamOptions
    {
        FullDocument = ChangeStreamFullDocumentOption.UpdateLookup,
    };

    using (var cursor = await _collection.WatchAsync(options))
    {
        _logger.LogInformation(&quot;Watching collection {String}&quot;, 
            _deployments.CollectionNamespace);

        await cursor.ForEachAsync(changeStreamDocument =&gt;
        {
            var document = changeStreamDocument.FullDocument;
            _logger.LogInformation(&quot;Received document: {String}&quot;, 
                document.ToString());
        });
    }
}
</code></pre>
<p>The first log appears stating that it is watching the collection with the correct namespace. I then add a document to the collection expecting to see something log as &quot;Received document: ...&quot; but nothing logs.</p>
<p>I followed the async pattern given in the documentation <a href="https://mongodb.github.io/mongo-csharp-driver/2.9/reference/driver/change_streams/#watching-changes-in-a-single-collection" rel="nofollow noreferrer">here</a>.</p>

