How to fix MongoDB array concatination error?<p>I have a collection in mongodb with a few million documents. there is an attribute(categories) that is an array that contains all the categories that a document belongs to. I am using following query to convert the array into a comma separated string to add it to SQL server through a spoon transformation.
for example
the document has [&quot;a&quot;,&quot;b&quot;,&quot;c&quot;,...] and i need a,b,c,.... so i can pit it in a column</p>
<pre><code>categories: {
        $cond: [
          { $eq: [{ $type: &quot;$categories&quot; }, &quot;array&quot;] },
          {
            $trim: {
              input: {
                $reduce: {
                  input: &quot;$categories&quot;,
                  initialValue: &quot;&quot;,
                  in: { $concat: [&quot;$$value&quot;, &quot;,&quot;, &quot;$$this&quot;] }
                }
              }
            }
          },
          &quot;$categories&quot;
        ]
      }
</code></pre>
<p>when i run the query i get the following error and i cannot figure out what the problem is.</p>
<pre><code>com.mongodb.MongoQueryException: Query failed with error code 16702 and error message '$concat only supports strings, not array' on server
</code></pre>
<p>a few documents had this attribute as string and not array so i added a type check. but still the issue is there. any help on how to narrow down the issue will be very appreciated.</p>
<p>A few other attributes were the same in the same collection and this query is working fine for the rest of them.</p>

