Using Spring Boot auto configuration of MongoDB with Camel, how to know what application.properties<p>I'm trying to add a Camel rout to a working project with Spring Boot for using MongoDB. I've using Mongo with Spring Boot autoconfigure, and it worked pretty easily.</p>
<p>I was confused about how to specify the bean that Spring Boot generates, but I finally found an answer to a related question on SO that said the name of the bean is &quot;mongo&quot;. So I changed my rout to .to(&quot;mongodb:mongo?....</p>
<p>No Spring is trying to connect to default parameters, localhost and 72017, etc. So how do I figure out what properties to specify in application.properties to set the connection parameters? The documentation isn't being helpful here.</p>
<p>{Edit: I managed to figure this out. The below works now}</p>
<p>Here are the Maven dependencies I added:</p>
<pre><code>&lt;dependency&gt;
    &lt;groupId&gt;org.apache.camel&lt;/groupId&gt;
    &lt;artifactId&gt;camel-mongodb&lt;/artifactId&gt;
    &lt;version&gt;${camel-version}&lt;/version&gt;
&lt;/dependency&gt;
&lt;dependency&gt;
  &lt;groupId&gt;org.apache.camel.springboot&lt;/groupId&gt;
  &lt;artifactId&gt;camel-mongodb-starter&lt;/artifactId&gt;
  &lt;version&gt;${camel-version}&lt;/version&gt;
&lt;/dependency&gt;
</code></pre>
<p>And here are the additions to my application.properties file</p>
<pre><code>spring.data.mongodb.host=&lt;IP&gt;
spring.data.mongodb.port=27017
spring.data.mongodb.database=dev
spring.data.mongodb.username=test
spring.data.mongodb.password=password
</code></pre>
<p>And the Camel route:</p>
<pre><code>package Order;

import org.apache.camel.builder.RouteBuilder;
import org.springframework.stereotype.Component;

@Component
public class OrderRouter extends RouteBuilder {

    @Override
    public void configure() {

        // Process message
        from(&quot;jms:topic:order&quot;)
        .log(&quot;JMS Message: ${body}&quot;)
            .choice()
                .when().jsonpath(&quot;$.[?(@.type=='partial')]&quot;)
                    .to(&quot;mongodb:mongo?database=dev&amp;collection=order&amp;operation=insert&quot;);

    }

}
</code></pre>
<p>Does this mean I need to define a bean when connecting with Camel? Looking at the documentation it seems that it should generate a bean by adding camel-mongodb-starter along with the application.properteis</p>
<p><a href="https://camel.apache.org/components/latest/mongodb-component.html#_spring_boot_auto_configuration" rel="nofollow noreferrer">https://camel.apache.org/components/latest/mongodb-component.html#_spring_boot_auto_configuration</a></p>

