                    .to(&quot;mongodb:mongo?database=dev&amp;collection=order&amp;operation=insert&quot;);

    }

}
</code></pre>
<p>Does this mean I need to define a bean when connecting with Camel? Looking at the documentation it seems that it should generate a bean by adding camel-mongodb-starter along with the application.properteis</p>
<p><a href="https://camel.apache.org/components/latest/mongodb-component.html#_spring_boot_auto_configuration" rel="nofollow noreferrer">https://camel.apache.org/components/latest/mongodb-component.html#_spring_boot_auto_configuration</a></p>; Answer: viewDidAppear is always called on the main queue. This code is actually scheduling becomeFirstResponder() to happen on a future iteration of the main queue, allowing UISearchController to finish whatever it hasn't done yet at this moment.

